// eslint-disable-next-line
import React, {Component} from 'react';
import logo from '../assets/images/logo.svg';
import {NavLink} from 'react-router-dom';

class Header extends Component{
    render(){
        return(
            <header id="header">

                <div className="center">

                    <div id="logo">
                        <img src={logo} classNameName="app-logo" alt="Logotipo"></img>
                        <span id="brand"><strong>Curso</strong>React</span>
                    </div>
                    
                    <nav id="menu">
                        <ul>
                            <li><NavLink to="/">Inicio</NavLink></li>
                            <li><NavLink to="/ruta-prueba">Blog</NavLink></li>
                            <li><NavLink to="/ruta-componente">Formulario</NavLink></li>
                            <li><NavLink to="/pagina-1">Pagina 1</NavLink></li>
                            <li><NavLink to="/pruebas/Alvarrette">Pagina 2</NavLink></li>

                        </ul>
                    </nav>

                    <div className="clearfix"></div>
                </div>

            </header>
        );
    }
}
export default Header;
